import {useState} from 'react'
import './styles.css'

import Cart from './components/Cart.js'
import Messages from './components/Messages.js'

localStorage.clear();
let imgs = [];
for(let i = 0; i < 10; i++) {
  const imgObj = {
    Name: `Name`,
    Description: 'Some desk',
    Image: 'data:image/png;base64,',
    Price: 101
  };
  imgs.push(imgObj)
}
localStorage.setItem('images', JSON.stringify(imgs));

localStorage.setItem('answer1', JSON.stringify(['what is your name?', '']));
localStorage.setItem('answer2', JSON.stringify(['how are you?', '']));
localStorage.setItem('answer3', JSON.stringify(['what do you want to do?', '']));


function App() {

    const [numPage, setNumPage] = useState(1);
    const [ans, setAns] = useState('');
    const [numAsk, setNumAsk] = useState(1);
    const [windowWidth, setWindowWidth] = useState(() => document.body.clientWidth);

    const [newImage, setNewImage] = useState('');
    const [name, setName] = useState('');
    const [desc, setDesc] = useState('');
    const [price, setPrice] = useState('');

    const setFkingRerender = useState('')[1];

    const isMobile = windowWidth < 768;

    const imgs = JSON.parse(localStorage.getItem('images'));

    let imgCarts = imgs ? imgs.map((imgObj, i) => <Cart imgs={imgs} func={(value) => setFkingRerender(value)} index={i} imgObj={imgObj}/>) : '';
    const amountCarts = isMobile ? 2 : 4;
    const amountPages = Math.ceil(imgCarts.length / amountCarts);

    let curCarts = [];

    window.addEventListener('resize', e => {
        setWindowWidth(document.body.clientWidth)
    });

    for (let i = (numPage - 1) * amountCarts; i < Math.min(numPage * amountCarts, imgCarts.length); i++) {
        curCarts.push(imgCarts[i])
    }

    function CreateButton(num, numPage) {
        let res = [];
        for(let i = 1; i <= num; i++) {
            if(numPage === i) {
                res.push(<button className='pag-btn pag-btn-active' key={'pag-btn' + i} onClick={() => setNumPage( i )}>{i} </button>);
                continue
            }
            res.push(<button className='pag-btn' key={i} onClick={() => setNumPage( i )}>{i} </button>)
        }
        return res
    }

    function ansHandler(e) {
        e.preventDefault();
        if(numAsk < 4) {
            localStorage.setItem(`answer${numAsk}`, JSON.stringify([JSON.parse(localStorage[`answer${numAsk}`])[0], e.target.ans.value]));
            setNumAsk(Math.min(numAsk + 1, 4));
        }

        setAns('')
    }
    
    function openChat(e) {
        e.preventDefault();

        const chat = document.querySelector('.chat');
        const carts = document.querySelector('.carts');
        const pag = document.querySelector('.pagination');

        if(!chat.style.display) {
            chat.style.display = 'inline-block';
            carts.style.display = 'none';
            pag.style.display = 'none'
        } else {
            chat.style.display = '';
            carts.style.display = 'flex';
            pag.style.display = 'inline-block'
        }
    }

    function inputValidation(e) {
        const value = e.target.value;
        const submitBtn = document.querySelector('#newCartSubmit');

        if(/^[0-9]+$/.test(value)) {
            e.target.className = 'resolveInput';
            submitBtn.disabled = false
        } else if(value === '') {
            e.target.className = ''
            submitBtn.disabled = true
        } else {
            e.target.className = 'rejectedInput'
            submitBtn.disabled = true
        }
    }

    function addNewFile(file) {

        const reader = new FileReader();

        reader.onload = () => {
            const base64string = 'data:' + file.type + ';base64,' + reader.result.replace(/^.+,/, "");
            setNewImage(base64string)
        };
        reader.readAsDataURL(file);
    }

    function addNewCart(e) {
        e.preventDefault();



        const formData = new FormData(e.target);
        const formObj = Object.fromEntries(formData);

        formObj.Image = newImage;

        let res = []

        if(!imgs) {
            res = formObj
        } else if(imgs.length === 1) {
            res = [imgs, formObj]
        } else res = [...imgs, formObj];

        try {
            localStorage.setItem('images', JSON.stringify(res))
        } catch (e) {
            alert(e.message)
        }

        fetch('www.example.com', {
            method: 'POST',
            headers: {
                'ContentType': 'json',
            },
            body: JSON.stringify(res)
        }).then((data) => data.ok ? console.log(data.json()) : alert(data.statusText))
            .catch(err => alert(err.message));

        setNewImage('');
        setName('');
        setDesc('');
        setPrice('');
    }

    return (
        <div className="App">
            <div className="frame">

                <div className="container">
                    <div className='carts'>
                        {curCarts}
                    </div>
                    <div className="pagination">
                        <button className='pag-btn' onClick={() => setNumPage( (numPage - 1) || 1)}> &lt; </button>
                        {CreateButton(amountPages, numPage)}
                        <button className='pag-btn' onClick={() => setNumPage( Math.min(numPage + 1, amountPages) )}> &gt; </button>
                    </div>
                </div>

                <div className="open-chat" onClick={e => openChat(e)}>
                    <img src={process.env.PUBLIC_URL + '/img/chat.png'} alt="png"/>
                </div>

                <div className='chat'>
                    <div className='messages'>
                        <Messages numAsk={numAsk}/>
                    </div>

                    <form onSubmit={ansHandler}  action="">
                        <div className='chat-container'>
                            <textarea id='ans'
                                      name='ans'
                                      onInput={(e) => setAns(e.target.value)}
                                      value={ans}
                                      placeholder='Write a message'
                                      rows='6'/>
                            <button type='submit'>&#10148;</button>
                        </div>
                    </form>

                </div>

            </div>
            <div className='form-add-cart'>
                <form id='newCart' onSubmit={e => addNewCart(e)} action="#">

                    <input type="file" id='newImg' name='Image' onChange={e => addNewFile(e.target.files[0])}/>
                    <label htmlFor="newImg">
                        <div className='upload-block'>
                            <div>&#10010;</div>
                            <div>upload</div>
                        </div>
                    </label>

                    <fieldset>
                        <h5>Name</h5>
                        <input type="text" name='Name' placeholder='Enter name' value={name} onChange={e => setName(e.target.value)}/>
                    </fieldset>

                    <fieldset>
                        <h5>Description</h5>
                        <input type="text" name='Description' placeholder='Enter description' value={desc} onChange={e => setDesc(e.target.value)}/>
                    </fieldset>

                    <fieldset>
                        <h5>Price</h5>

                        <div className="price">
                            <input type="text"
                                   id='one'
                                   name='Price'
                                   placeholder='Enter price'
                                   onChange={e => {
                                       inputValidation(e);
                                       setPrice(e.target.value)
                                   }}
                                   value={price}
                            />
                        </div>
                    </fieldset>


                    <button type='submit' id='newCartSubmit'>Save</button>
                </form>
            </div>

        </div>
    );
}

export default App;
